import { GlobalUrl } from '../../../axios'

const HistoricalData = () => {
    const [History,setHistory] = useState(
        {
            Cases : [],
            Recovered : [],
            Deaths : []
        }
    )
    useEffect(() =>
    {
        GlobalUrl.get('/historical/all')
        .then(resp =>
            {
                setHistory(
                    {
                        Cases : Object.values(resp.data.cases),
                        Recovered : Object.values(resp.data.recovered),
                        Deaths : Object.values(resp.data.deaths)
                    }
                )
            })
        .then(err =>
            {
                console.log(err);
